CREATE DATABASE IF NOT EXISTS webtraffic;

USE webtraffic;

CREATE TABLE IF NOT EXISTS `website` (  
  `website_id` varchar(250) NOT NULL,       
  `website_name` varchar(250)  NOT NULL,     
  `website_type`  varchar(250)  NOT NULL,     
  `region` varchar(250)  NOT NULL,
   PRIMARY KEY  (`website_id`)
);

CREATE TABLE IF NOT EXISTS `ad_source` (  
  `ad_source_id` varchar(250) NOT NULL,       
  `ad_source_name` varchar(250)  NOT NULL,     
  `payment_partner`  varchar(250)  NOT NULL,     
  `pay_per_click` float  NOT NULL,
   PRIMARY KEY  (`ad_source_id`)
);

CREATE TABLE IF NOT EXISTS `pages` (  
  `page_id` varchar(250) NOT NULL,       
  `category` varchar(250)  NOT NULL,     
  `target_gender`  varchar(250)  NOT NULL,     
  `target_age` varchar(250)  NOT NULL,
   PRIMARY KEY  (`page_id`)
);

CREATE TABLE IF NOT EXISTS `webstats` (
  `day_date` date NOT NULL,
  `website_id` varchar(250) NOT NULL,       
  `page_id` varchar(250) NOT NULL,     
  `no_users` bigint(15) NOT NULL,     
  `ad_source_id` varchar(250) NOT NULL,    
  `ad_impressions` bigint(15) NOT NULL,
  `ad_click` bigint(15) NOT NULL,
  FOREIGN KEY (website_id) REFERENCES website(website_id),
  FOREIGN KEY (page_id) REFERENCES pages(page_id),
  FOREIGN KEY (ad_source_id) REFERENCES ad_source(ad_source_id)
);

